create table locations
(
    id          serial
        constraint locations_pkey
            primary key,
    name        varchar,
    state       varchar,
    city        varchar,
    address     varchar,
    postal_code varchar,
    country_id  integer
        constraint fk_locations_countries
            references countries
);

