create table employee
(
    id            serial
        constraint employee_pkey
            primary key,
    first_name    varchar,
    last_name     varchar,
    birthdate     date,
    department_id integer
        constraint fk_employee_department
            references department,
    salary        integer,
    photo         bytea
);

